message:
Qualquer ameaça ao Armageddon nuclear é vazia porque nem a Máfia Hazara nem o regime falso de Biden controlam quaisquer armas nucleares.  Lembre-se quando Trump saiu da Casa Branca, ele levou Mar-a-Lago e as malas nucleares com ele.  E a caixa do botão vermelho está sempre ao lado dele em sua mesa, não importa onde ele esteja - no chão ou no ar.  Mas como mencionado várias vezes antes, o cenário envolve Defcon-1, com as sirenes de ameaça nuclear.  Será uma bandeira falsa - para intimidar o inimigo e acordar o que ainda não foi despertado.  Então não há com o que se preocupar.
@Iskra Loukanova 
https://t.me/PatriotasPeloMundo 🇧🇷🇧🇷🇧🇷
